import axios, { AxiosResponse } from "axios";
import PhotoData from "../types/photoData";

// add a date range here
const get = async (): Promise<AxiosResponse<PhotoData[], any>> => {
  try {
    const result = await axios
      .get<PhotoData[]>(
        `https://api.nasa.gov/planetary/apod?api_key=ykzQINaucAEoc1RW6I3CqVke24wjlu9JAyrDVcKd&start_date=2022-01-02`
      )
      .then((response) => {
        return response.data;
      });
  } catch {
    console.error("There was an error retrieving the data");
    return undefined;
  }
};

const PhotoService = {
  get,
};

export default PhotoService;
